  .cmd-result-page {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    width: 100%;
    height: 100%;
    text-align: center;
    padding: 40upx 0;

    &-image {
      width: 280upx;
      height: 280upx;
      margin-bottom: 80upx;
    }

    &-text {
      line-height: 1;
      color: #111a34;
      font-size: 36upx;
    }

    &-subtext {
      margin-top: 16upx;
      color: #858b9c;
      font-size: 32upx;
    }

    &-buttons {
      display: flex;
      flex-direction: row;

      button {
        margin: 10upx;
      }
    }

  }
</style>
